    <script>
        let systemLang = window.localStorage.getItem('lang') || '';
let systemMode = window.localStorage.getItem('systemMode') || '';
 let name = 'name';
        let hName = 'hName';
        let fName = 'fName';
function loadData(filter='') {
    let template = '';
       name = 'name';
         hName = 'hName';
         fName = 'fName';
        if(systemLang) {
            name = 'nameMl';
            hName = 'hNameMl';
            fName = 'fNameMl';
            $('#btn-ml').addClass('btn-primary');
        } else {
             $('#btn-ml').removeClass('btn-primary');
        }
    if (systemMode) {
        $('#btn-sys').addClass('btn-primary');
        let i = 0;
         for (let key in newHouseList) {
             if (key.startsWith(filter)) {
                 i++;
                template += `<li class="list-group-item" data-toggle="collapse" data-target="#h-${key.replace(' ','-')}">
                           ${key} <b>(${newHouseList[key].length})</b>
                           <div id="h-${key.replace(' ','-')}" class="collapse"><ul>`;
                newHouseList[key].forEach((item, index) => {
            template += getItem(item);;
        });
             template +=`</ul></div>
                        </li>`;
             }

         }
          $('#voterCount').html(i + ' Houses');
          $('.list-group').html(template);

    } else {
        $('#btn-sys').removeClass('btn-primary');
        const newList = votersList.filter(item => item.name.startsWith(filter) ||  item.fName.startsWith(filter)|| item.hName.startsWith(filter) );
        newList.forEach((item, index) => {
            template += getItem(item);
        });
        $('.list-group').html(template);
        $('#voterCount').html(newList.length + ' Voters');
    }

}

function getItem(item) {
    return `<li class="list-group-item">
<div class="voter-card">
             <div class="img-wrap">
                <img src="https://shahul-vm.github.io/per/image/${item.boothType}/${item.no}.jpg" alt="">
             </div>
             <div class="content-wrap">
              <b>${item[name]} (${item.age})</b> ${item[hName]} / ${item[fName]}
              <br />
              ${item.booth}/ ${item.hNo} / ${item.no}
              <br />
              ${item.idNo}
</div>

</div>

            </li>`;
}

function filterData(t) {
    loadData(t.value.toLowerCase());
}

function changeLang() {
    if(!systemLang) {
         systemLang = 'Ml'
         window.localStorage.setItem('lang', 'ml');
    } else {
        systemLang = '';
        window.localStorage.removeItem('lang')
    }
    loadData($('#filterData').val().toLowerCase());
}

function changeMode() {
    if(!systemMode) {
         systemMode = 'home'
         window.localStorage.setItem('systemMode', 'home');
    } else {
        systemMode = '';
        window.localStorage.removeItem('systemMode')
    }
    loadData($('#filterData').val().toLowerCase());
}


    </script>
